import React from 'react';
import { AppStateProvider } from './context/AppStateContext';
import CPRTempoApp from './components/CPRTempoApp';
import ResetButton from './components/Buttons/ResetButton';

function App() {
  return (
    <AppStateProvider>
      <CPRTempoApp />
      <ResetButton />
    </AppStateProvider>
  );
}

export default App;
